package cn.cem.Bean;

/**
 * @author HXF
 * weibo Bean
 */
public class Weibo {
	private int id;
	private String wid;
	private String uid;
	private String zanNum;
	private String zfNum;
	private String cmtNum;
	private String content;
	private String pubTime;
	private String cmtUrl;
	private String item;
	
	public Weibo() {
		super();
		// TODO Auto-generated constructor stub
	}
	public int getId() {
		return id;
	}
	public void setId(int id) {
		this.id = id;
	}
	public String getWid() {
		return wid;
	}
	public void setWid(String wid) {
		this.wid = wid;
	}
	public String getUid() {
		return uid;
	}
	public void setUid(String uid) {
		this.uid = uid;
	}
	public String getZanNum() {
		return zanNum;
	}
	public void setZanNum(String zanNum) {
		this.zanNum = zanNum;
	}
	public String getZfNum() {
		return zfNum;
	}
	public void setZfNum(String zfNum) {
		this.zfNum = zfNum;
	}
	public String getCmtNum() {
		return cmtNum;
	}
	public void setCmtNum(String cmtNum) {
		this.cmtNum = cmtNum;
	}
	public String getContent() {
		return content;
	}
	public void setContent(String content) {
		this.content = content;
	}
	public String getPubTime() {
		return pubTime;
	}
	public void setPubTime(String pubTime) {
		this.pubTime = pubTime;
	}
	public String getCmtUrl() {
		return cmtUrl;
	}
	public void setCmtUrl(String cmtUrl) {
		this.cmtUrl = cmtUrl;
	}
	public String getItem() {
		return item;
	}
	public void setItem(String item) {
		this.item = item;
	}

}
